import React from 'react';
import { Container, Grid } from '@material-ui/core';
import Post from './Post/Post';


const Posts = () => {
    const imgSrc = "data:image/jpeg;base64,";
    const PostDescription = "Some text over here to fill up the post Description over here"; 
    const PostTitle = "Post title goes here"; 

    return (
        <Container>
            <h1>Posts: The item to be displayed</h1>
            <Post imgSrc={imgSrc} PostTitle={PostTitle} PostDescription={PostDescription} />
        </Container>
    );
};

export default Posts;
